// TopBar.js
import React from "react";
import "../topbar.css"; // Certifique-se de criar este arquivo de estilo

const Icon1 = () => (
    <Svg height="30" width="30">
      <Circle cx="15" cy="15" r="10" fill="blue" />
    </Svg>
  );
  
  const Icon2 = () => (
    <Svg height="30" width="30">
      <Circle cx="15" cy="15" r="10" fill="green" />
    </Svg>
  );
  
  const Icon3 = () => (
    <Svg
      xmlns="http://www.w3.org/2000/svg"
      width="24"
      height="24"
      viewBox="0 0 24 24"
      fill="none"
      tint="#000000" // Defina a cor do ícone aqui se necessário
    >
      <Path
        fill="#FFFFFF" // Cor branca, que pode ser alterada conforme necessário
        d="M17,7l-1.41,1.41L18.17,11H8v2h10.17l-2.58,2.58L17,17l5,-5zM4,5h8V3H4c-1.1,0 -2,0.9 -2,2v14c0,1.1 0.9,2 2,2h8v-2H4V5z"
      />
    </Svg>
  );

const TopBar = () => {
  return (
    <header className="top-bar">
      <h1 className="logo">ForForca</h1>
      <div className="icons">
        <Icon1 className="icon icon1" /> 
        <Icon2 className="icon icon2" />
        <Icon3 className="icon icon3" /> 
      </div>
    </header>
  );
};

export default TopBar;
